import React, { Children, createElement } from 'react'
import './ProdName.scss'

const ProdName = (props) => {
    console.log(props.prod);

    const getNavHandler = (elem) => {
        let home = createElement('span', {
            children: "Home / "
        })
        let style = createElement('span', {
            children: `${elem.view} / `
        })
        let name = createElement('span', {
            children: `${elem.name}`
        })
        console.log(home,style,name)
    }

    return(
        <div className="name-wrapper">
            <div className="name-nav">
                <p>{getNavHandler(props.prod)}</p>
            </div>

            <div className="name-price"></div>

            <div className="name-count"></div>
        </div>
    )
}


export default ProdName
